text:
 @isaquemartins1110  Sou corintiano, acho que o Juventude ganha. Por dois motivos: 
1° se o Corinthians vencer o Grêmio, já garante a vaga na fase de grupos e assim não vai expor ao risco, no último jogo da temporada o Renato Augusto, Willian, Giuliano Fagner, Roger Guedes, Cássio e talvez a dupla de zaga nesse jogo "morto" contra o Juventude, bem provável usar os reservas. 

2° O Corinthians do Sylvinho, fora de casa e sem o apoio da torcida que faz o time ganhar no abafa e não na tática, simplesmente não existe. É igual um time de puta.
